export default function AdminPanel() {
  return (
    <div>
      <h2>Admin Panel</h2>
      <ul>
        <li>Manage Properties</li>
        <li>View Tenants</li>
        <li>Review Maintenance Requests</li>
        <li>Access Smart Passcodes</li>
      </ul>
    </div>
  );
}
